import React from "react";
import { Container, Row, Col, Button, Navbar, Nav } from "react-bootstrap";
const Home = () => {
	return (
		<Container fluid className="text-center bg-body-secondary">
			<Row>
				<Col>
					<h1>Home</h1>
				</Col>
			</Row>
		</Container>
	);
};

export default Home;
